import React, { Component } from "react";
import { useFormik } from "formik";

class appointment extends Component {
  render() {
    const formik = useFormik({
      initialValues: {
        email: "",
        name: "",
        accountNumber: "",
        reduction: "",
      },
      onSubmit: (values) => {
        alert(JSON.stringify(values));
      },
    });
    return (
      // Appointment section start
      <section className="appointment">
        <div className="appointment-wrap">
          <figure>
            <img src={require("../assets/images/resto.jpg")} alt="" />
          </figure>
          <div className="appointment-form">
            <form action="#">
              {/* <div className="form-field half-width">
                <input type="date" placeholder="date" />
    </div>*/}
              <div className="form-field half-width">
                <input
                  type="text"
                  placeholder="NOM"
                  required
                  id="name"
                  name="name"
                  onChange={formik.handleChange}
                  value={formik.values.name}
                />
                <input
                  type="email"
                  placeholder="Adresse Email"
                  required
                  value={this.state.prospect.email}
                />
              </div>
              <div className="form-field half-width">
                <div className="select-field">
                  <input
                    type="number"
                    placeholder="NOMBRE DE COMPTE"
                    required
                    value={this.state.prospect.accountNumber}
                  />
                </div>
              </div>
              <div className="form-field half-width">
                <div className="select-field">
                  <select>
                    <option>Selectionner le %age de r√©duction</option>
                    <option>0%</option>
                    <option>10%</option>
                    <option>20%</option>
                    <option>30%</option>
                    <option>40%</option>
                    <option>50%</option>
                    <option>60%</option>
                    <option>70%</option>
                    <option>80%</option>
                    <option>90%</option>
                    <option>100%</option>
                  </select>
                </div>
              </div>
              {/*<div className="form-field">
                <textarea name="notes" placeholder="Your notes"></textarea>
    </div>*/}
              <button className="btn btn-round">Envoyer la proposition</button>
            </form>
          </div>
        </div>
      </section>
      // Appointment section end
    );
  }
}

export default appointment;
